import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <form>
        <h1>Generate Meal Plan</h1>
        <label for="duration">Duration</label>
        <input type="radio" id="day" name="duration" value="day"/>
        <input type="radio" id="week" name="duration" value="week"/>
      </form>
    </div>
  );
}

export default App;
